interface Data {
    userId: number;
    id: number
    title: string;
    body: string
}


interface Props {
    data?: Data[];
}

export default function Post({data}: Props) {

  return (
    <div>
      {
        data.map((item, index) => {
            return (
                <div>
                    <p>{item.title}</p>
                </div>
            )
        })
      }
    </div>
  )
}
